/**
 * Fmt.
 *
 * @param d the d
 * @return the string
 */
public static String fmt(Double d){
	
	if(d!=null){
		if(d == (long) d.doubleValue())
			return String.format("%d",(long)d.doubleValue());
		else
			return String.format("%s",d);
	}else{
		return "0";
	}
}

